%[text] ## 1.1 Simulation of Thrust Command
%[text] ![](text:image:1b20)
%[text] (source: [https://speedybee.zendesk.com/hc/en-us/articles/21010843329563-How-does-the-flight-controller-connect-with-a-single-ESC](https://speedybee.zendesk.com/hc/en-us/articles/21010843329563-How-does-the-flight-controller-connect-with-a-single-ESC))
%[text] Modern multirotor drones control their motors using **Electronic Speed Controllers (ESCs)**. The flight controller computes how much thrust each motor should produce and sends this command to the ESC. In many drone systems, this command is transmitted using a simple and robust signal called **Pulse Width Modulation (PWM)**.
%[text] PWM communication originated in early radio-controlled aircraft, where servos were driven by timed electrical pulses. When electronic speed controllers replaced mechanical motor controllers, they adopted the same pulse-based interface for compatibility with existing radio equipment. As a result, PWM became the standard method for commanding motor controllers in hobby and research drones for many years.
%[text] In a PWM control signal, information is encoded in the **duration of a high-voltage pulse** that repeats at a fixed frequency. For typical drone ESCs:
%[text] - The signal repeats every **20 ms** (50 Hz)
%[text] - A **1.0 ms** pulse represents minimum motor command (zero thrust)
%[text] - A **2.0 ms** pulse represents maximum motor command (maximum thrust) \
%[text] The ESC measures the pulse width, checks that it is valid, and converts it into electrical power for the motor. If the signal is lost or invalid, the ESC can safely shut down the motor.
%[text] In this exercise, you will implement a simplified version of a flight controller that generates a PWM signal from a thrust command.
%[text] ### 1.1.1 Check the Simulation Configuration
%[text] To open the Simulink model run this code section below:
load_system('ThrustCommand')              
open_system('ThrustCommand','tab')
%[text] Then go to "Model Settings" in the modeling tab and verify that the solver has the following configuration:
%[text] ![](text:image:48e0)
%[text] ### 1.1.2 Simulink Dashboard
%[text] The goal is to let the simulation run infinitely so that we can change the pulse width dynamically and verify the correct change using a scope block. For this add the following elements to your Simulink model:
%[text] - Toggle Switch 
%[text] - Slider
%[text] - Scope \
%[text] We will use the switch to arm and disarm the motor. When the motor is disarmed the PWM signal should represent the minimum motor command. The slider will be used to input a thrust command. Set the bounds of the slider to \[0,1\]. The position of this slider will later be mapped to the pulse width when the switch is armed. Connect these elements to two constant blocks and change the value of the constants while the simulation is running. 
%[text] ### 1.1.3 PWM Signal
%[text] Create the PWM signal by creating a subsystem that takes the two constants controlled by the dashboard blocks as input and outputs a PWM signal that you connect to the scope. The PWM signal should have low-voltage 0V, high-voltage 1V, 50 Hz frequency and the pulse width characteristics specified in the introduction. Show your results to the TA.
